import React, { useState } from 'react';
import Calendar from 'react-calendar';

function App() {
  const [value, setValue] = useState(new Date());

  function onChange(nextValue) {
    setValue(nextValue);
  }

  return (
    <Calendar
      onChange={onChange}
      value={value}
    />
  );
  
  // return <h1>
  //   Konnichiwa Worlds
    
  // </h1>
}

export default App
